import React, { useState, useEffect } from "react";
import axios from "axios";
import { urlApiMain } from "../../utils/url";

const EditUser = () => {
  const [profil, setProfil] = useState([]);

  const getProfil = () => {
    axios
      .get(`${urlApiMain}profil`)
      .then((res) => {
        setProfil(res.data[0]);
      })
      .catch((err) => {});
  };

  useEffect(() => {
    getProfil();
  }, []);

  return (
    <div className="flex justify-center">
      <div className="bg-white md:w-1/4 mt-6 rounded shadow-md px-6 py-6">
        <p className="font-semibold text-lg">Edit Profil</p>
        <label className="bloc text-gray-700 text-sm font-bold mb-2">
          Name
        </label>
        <input
          type="text"
          name="name"
          value={profil.name}
          className="mt-2 shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
        //   onChange={(e) => onInputChange(e)}
          placeholder="Robert"
        />
      </div>
    </div>
  );
};

export default EditUser;
